description:
Verenigde Staten
Komedie
85 minuten

geregisseerd door David Zucker
met Leslie Nielsen, Priscilla Presley en Ricardo Montalban

Lt. Frank Drebin (Nielsen) is een agent die ervoor moet zorgen dat het bezoek van koningin Elizabeth goed verloopt. Helaas heeft Drebin geen enkel benul waar hij mee bezig is en al stuntelend komt hij terecht in een complot om de koningin te vermoorden.

